from PIL import Image


def get_symbol(color):
    #я знаю, что это не лучшее решение
    #i know, it bad solution
    if color < 23:
        return ' '
    if color >= 23 and color < 46:
        return '·'
    if color >= 46 and color < 69:
        return '~'
    if color >= 69 and color < 92:
        return '+'
    if color >= 92 and color < 115:
        return '≈'
    if color >= 115 and color < 137:
        return 'x'
    if color >= 137 and color < 160:
        return '#'
    if color >= 160 and color < 183:
        return 'm'
    if color >= 183 and color < 206:
        return 'X'
    if color >= 206 and color < 229:
        return 'M'
    if color >= 229:
        return 'W'

